import React from "react";
import classes from './Menu.modules.css';

const Menu = (props) =>{
    return (
        // <div>
        //     <p>This is our new menu</p>
        // </div>
        <form className={classes.menu}>
            <ul>
                {props.roleList.map(role=>{
                    console.log(role);
                    return(<li><input type="radio" name="radio"/>{role}</li>)
                })}
            </ul>
        </form>
    )
}

export default Menu;
